import React from 'react'

const Signup = () => {
  return (
    <div className='leftSideInnerArea'>
      <h1>Let's set up your Account</h1>
      <p>Already have an account? <a href='#'>Sign in</a></p>
    </div>
  )
}

export default Signup;
